import NavBar from './components/NavBar';
import Posts from './components/Posts';


function App() {
  return (
    <div className="App">



      <div className="container" style={{"backgroundColor": "#e3f2fd"}}>




        <header className="App-header">

        <NavBar />



        </header>

        <Posts />

      </div>
    </div>
  );
}

export default App;
